import React from 'react';
import {Helmet} from 'react';
import './App.css';
import Header from './components/Header';
import Homepage from './components/Homepage';
import Footer from './components/Footer';
import Products from './components/Products';
import ContactPage from './components/ContactPage';
import { BrowserRouter as BrowserRouter, Route, Routes, Link,Outlet } from 'react-router-dom';
import Layout from './components/Layout';
function App() {
  return (
    <>
     <BrowserRouter>
      <Routes>
      <Route path='/' element={<Layout/>}>
        <Route index element={<Homepage/>}/>
        <Route path='/products' element={<Products/>}/>
        <Route path='contact' element={<ContactPage/>}/>
      </Route>
      </Routes>
      </BrowserRouter>
      <Helmet>
      <script type="text/js" src="../src/jquery.min.js"></script>
      <script type="text/js"  src="../src/jquery.scrollex.min.js"></script> 
<script type="text/js"  src="../src/browser.min.js"></script>
<script type="text/js"  src="../src/breakpoints.min.js"></script>
<script type="text/js"  src="../src/util.js"></script>
<script  type="text/js"  src="../src/main.js"></script>
      </Helmet>
    </>
  );
}

export default App;
